import React from "react";
import { connect } from "react-redux";
import { addArticle, changeNumberOfPairs } from "../redux/actions/index";
import { Button } from "antd";
import styled from "styled-components";

function App(props) {
  return (
    <div>
      <button onClick={() => props.changeNumberOfPairs(90)}>change</button>
      <div>number of pairs : {props.numberOfPairs}</div>
      <Button type="primary">Button</Button>
      <H11>ttt</H11>
      {/* Game Grid */}
      {/* Game Control */}
    </div>
  );
}

const H11 = styled.h1`
  font-size: 35px;
  color: red;
`;

const mapStateToProps = (state) => ({
  cards: state.cards,
  numberOfPairs: state.numberOfPairs,
});

const mapDispatchToProps = (dispatch) => ({
  changeNumberOfPairs: (number) => dispatch(changeNumberOfPairs(number)),
});

export default connect(mapStateToProps, mapDispatchToProps)(App);
